남주 손 받고 트럭위에 올라갔는데
손을 왜 털어?
기분나쁘네..;

우루루룽님 스토리빈틈이라뇨
저들은 학생입니다. 그래서 선생님이 조용히 하면 된다라는것도 까먹는다고 선생님이 수업시간에 뭘들었냐고 말하는것도 나와있습니다 그리고 경보가 울리자 훈련인줄아는 학생들의 모습을 보면 이런상황은 자주일어나지 않아 당황을 한다는것을 예상하면 저런 스토리도 충분히 나올 수 있습니다. 우루루룽님, 좀비대처방법을 1도 모르면 조용히하는 방법은?바리게이트 쳐서 좀비들을 막는 방법은? 아직 초반부라 안나온것들이 많아 보이는데 너무 그러면 안되죠
그리고 스토리 전개이야기는 개인에 따라 달라요;;

아니 의료팀 저격할려고 파쿠르로 쎈놈 지나친거고
막컷은 다음화에 자세히 알려주겠지
멍청한놈 한두명이 지가이해못한거로 베댓가고 그거로 물타기하네;

정상인: 저 사진이 왜 있을까?
쿵쾅: 와 주인공 한남새끼네;
이 차이임 ㅇㅋ? 나오지도 않은 내용을 지가 무슨 선구자인 것 마냥ㅎ;
